#include <iostream>

using namespace std;

struct ListNode {
  int val;
  ListNode *next;
  ListNode(int x) : val(x), next(NULL) {}
};

struct TreeNode {
  int val;
  TreeNode *left;
  TreeNode *right;
  TreeNode(int x) : val(x), left(NULL), right(NULL) {}
};

class Solution {
 private:
  ListNode *listHead;

  bool findRes(ListNode *current, TreeNode *root) {
    if (current == NULL) {
      return true;
    }
    if (root == NULL) {
      return false;
    }
    if (current->val == root->val) {
      current = current->next;
    } else {
      current = listHead;
      if (current->val == root->val) {
        current = current->next;
      }
    }
    return findRes(current, root->left) || findRes(current, root->right);
  }

 public:
  bool isSubPath(ListNode *head, TreeNode *root) {
    listHead = head;
    return findRes(head, root);
  }
};
